import React from 'react'
import {Link} from 'react-router-dom';

export default function Wines(props) {
    const { wines, currentUser } = props;

    return (
        <div>
            {wines.map(wine=> (
                <React.Fragment key={wine.id}>
                    <Link to={`/wines/${wine.id}`}><p>{wine.name}</p></Link>
                </React.Fragment>
            ))}
        </div>
    )
}
